import React from 'react';
//import components for project
import HeroImage from './components/HeroImage';


export default function HeroContent(){
    return(
        <div className="container sw-hero sw-hero--home u-space-2-bottom">
        <HeroImage/>
            <div class="sw-hero-content u-space-1-bottom">
                <h1 class="sw-title mb-4">
                Never waste a marketing lead again
                </h1>
                <p class="sw-title-summary h4 mb-4 mb-sm-7">
                We do something really boring, but valuable. We help you convert your MQLs and underserved pipeline, into qualified sales opportunities. And we do this at scale with some pretty cool AI technology under the hood.
                </p>
            </div>


        </div>
    )
}
